//import Companies from "./Components/Companies";
//import Guide from "./Components/Guide";
//import Properties from "./Components/Properties";
//import Details from "./Components/Details";
//import GetStarted from "./Components/GetStarted";
//import Footer from "./Components/Footer";
import Hero from "./myComponent/Heros";
import Cards from "./myComponent/Cards";
import Abouts from "./myComponent/Abouts";
import Skills from "./myComponent/Skills";
import Contacts from "./myComponent/Contacts";
import Footers from "./myComponent/Footers";

import { BrowserRouter as Router, Routes , Route} from "react-router-dom";

import React , { useEffect } from 'react'

//import Footer from "./Components/Footer";

function App() {

  const {pathname, hash, key} = useLocation();

  useEffect(() => {
    if (hash === '') {
      window.scrollTo(0, 0);
    }
    else {
      setTimeout(() => {
        const id = hash.replace('#','');
        const element = document.getElementById(id);
        if (element) {
          element.scrollIntoView();
        }
      }, 0);
    }
  }, [pathname, hash, key]);



  return (
    <>
    <Router>
    <Hero/>
        <Abouts/>
        <Cards/>
        <Skills/>
        <Footers/>
       <Routes>
         <Route path="/contact" element={<Contacts/>} />
       </Routes>
     </Router>
    </>
  );
}

export default App;
